The Harris County Clerk's office is encouraging students across Harris County to apply to work in the upcoming November 3, 2020 General Election. Students who are interested should apply no later than Friday, October 9, 2020.

Requirements:
Be 16 years of age or older on Election Day;
Be enrolled in a public, private, or qualified home school;
Be a U.S. citizen;
Have consent of their parent or legal guardian and their school principal (or parent/legal guardian for home-schooled students); and
Attend training classes prior to Election Day

Click the link to apply: https://www.harrisvotes.com/ElectionWorkers#studentClerks

