post_text:
Cobb 6th Grade’s Math/Science Club students competed in their first TMSCA competition on Saturday at Clements High School in Sugar Land against 13 other middle schools and numerous home-school students.

In number sense- Cobb’s Team ranking was Jase Tapiz, Jose Jimenez, Alejandro Martinez, Justin Saenz, and Daniel Salazar;

In calculator-Jase Tapiz received a 4th place trophy, the other team members were Gabriel Lucas, Daniel Salazar, Maria Gomez, and Jose Grimaldo;

In general math-Jase Tapiz, Daniel Salazar,and Justin Saez;

In science- Cobb’s top scores were by Evelyn Arredondo, Jase Tapiz, Alejandro Martinez, and Justin Saenz.

Other students competing were Abigail Ortiz, Dember Cosme, Ayanna Navarro, Nery Serrano, and Aryana Wehmeyer.

Congratulations and keep up the morning practices.

Thanks to Ayanna, Jase, Jose, Abigail, and Aryana parents for coming out and all the staff who continue to support the students for their hard work.

#GalenaParkISDExcellence

